/* import React from "react";
import ReactDOM from "react-dom";
import App from "./App";



  


ReactDOM.render( <App/> , document.getElementById("root"));
 */


const nums = [1, 2, 3, 4, 5]

const numsSquared = nums.map( function(num) {
    Math.pow(num,2), console.log(numsSquared) 
})
